import React, { useState, Component } from 'react';
import logo from './logo.svg';
import './App.css';
import List from "./components/List";
import AddToList from './components/AddToList';

export interface IState {
  people: {
    name: string
    age: number
    url: string
    note?: string
  }[]
}

function App() {

  const [people, setPeople] = useState<IState["people"]>([
    /*{
      name: "Basheerah Davids",
      age: 25,
      url: "https://media-exp1.licdn.com/dms/image/C5603AQGhYSxOlmSe6g/profile-displayphoto-shrink_800_800/0/1525950837905?e=2147483647&v=beta&t=9HGdvzUYNd3V7GI4ISJEo3aXUwL3JSfqVgsO3jF-GJY",
      note: "Cutest lady in the universe",
    }*/
  ])

  return (
      <div className="App">
        <h1>People invited to my Christmas party</h1>
        <List people={people}/>
        <AddToList setPeople={setPeople} people={people}/>
      </div>
  );
}

export default App;
